import React, { Component } from 'react'

class UserGreeting extends Component {
    
    constructor(props) {
        super(props)
    
        this.state = {
             isLoggedin: false
        }
    }
    
    
    render() {

        if(this.state.isLoggedin = true){
            return(
                <div>
                    Welcome Sawyer
                </div>
            )
        }
        else{
            return(
                <div>
                    Welcome Guest
                </div>
            )
        }
    }
}

export default UserGreeting
